import styled from "styled-components";
import COLOR from "./COLOR";
import BoxShadow from "./StyleComponents";

const MySkillContainer = styled.div`
    width: 44.8rem;
    height: 19.4rem;
    border-radius: 0.8rem;
    ${BoxShadow}
    background-color: ${COLOR.White};
    grid-column: 1/4;
    grid-row: 3/4;
    padding: 1.6rem;
`;
const H2 = styled.h2`
    font-size: 20px;
    font-weight: 400;
    margin: 0;
`;
const GraphContainer = styled.div`
    width: 6.5rem;
    height: 6.5rem;
    background-color: ${COLOR.GSF0};
`;
const PathCSS = styled.path`
    fill: transparent;
    stroke: 100px;
    stroke: ${COLOR.Primary};
`;

const GraphCircle = styled.circle`
    fill: transparent;
    stroke: ${COLOR.Primary};
    stroke-width: 1.2rem;
    stroke-dasharray: 10rem;
    stroke-linecap: round;
`
function SkillGraph () {
    return(
        <GraphContainer>
            <svg width='6.5rem' height='6.5rem'>
                <GraphCircle cx='32.5' cy='32.5' r='26'/>
            </svg>
        </GraphContainer>
    )
}

function MySkill() {
    return (
        <MySkillContainer>
            <H2>My Skills</H2>
            <SkillGraph></SkillGraph>
        </MySkillContainer>
    )
}

export default MySkill;
